{
    ::omnetpp::cMessage::parsimPack(b);
    doParsimPacking(b,this->origem);
    doParsimPacking(b,this->destino);
    doParsimPacking(b,this->status);
    doParsimPacking(b,this->task);
    doParsimPacking(b,this->titulo);
}

