{
    ::omnetpp::cMessage::parsimUnpack(b);
    doParsimUnpacking(b,this->origem);
    doParsimUnpacking(b,this->destino);
    doParsimUnpacking(b,this->status);
    doParsimUnpacking(b,this->task);
    doParsimUnpacking(b,this->titulo);
}

